function List(){

   // fruits.sort((a,b) => a.name.localeCompare(b.name)); 
    fruits.sort((a,b) => a.calories - b.calories);   

    const listItems = fruits.map(fruit => <li key={fruit.id}>
                                            {fruit.name}: &nbsp;
                                            <b>{fruit.calories}</b></li>);
    return(<ul>{listItems}</ul>);
}

export default List
